import Head from "next/head";
import styles from "../styles/Home.module.css";
import CamaronesAlPilpil from "../pages/src/img/camaronesalpilpil.jpeg";
import Americana from "../pages/src/img/Americana.jpg";
import CuatroCarnes from "../pages/src/img/CuatroCarnes.jpg";
import Hawaiana from "../pages/src/img/Hawaiana.jpg";
import CuatroQueso from "../pages/src/img/CuatroQueso.jpg";
import Italiana from "../pages/src/img/Italiana.jpg";
import Napolitana from "../pages/src/img/Napolitana.jpg";
import SuperPepperoni from "../pages/src/img/SuperPepperoni.jpg";
import Vegetariana from "../pages/src/img/Vegetariana.jpg";

export default function Home() {
  return (
    <div className={styles.container}>
      <Head>
        <title>De la Costa - Podructos del mar a domicilio en Rancagua y Machali</title>
      </Head>

      <main className={styles.main}>
        <h1 className={styles.title}>
          Bienvenidos a{" "}
          <a href="">
            De la Costa
          </a>
        </h1>
        <p className={styles.description}>De La Costa a tu hogar</p>{" "}
        <div className={styles.button}>
          <a href="https://wa.me/message/CTYZQI5JZWJTO1">
            <h3>Envia un WhatsApp &rarr;</h3>
          </a>
        </div>
        <div className={styles.grid}>
          <a href="" className={styles.card}>
            <img src={CamaronesAlPilpil} alt="RancaguaBBQ" className={styles.img} />
            <h3>Rancagua BBQ</h3>
            <p>Queso, or√©gano, pepperoni, pollo, tocino y salsa barbacoa.</p>
          </a>

          <a className={styles.card}>
            Beta Version - Sitio web en construccion - FullPizzas - Rancagua
          </a>
        </div>
      </main>
      <footer className={styles.footer}>
        <h2>+56 9 4855 0557</h2>
      </footer>
    </div>
  );
}
